import React from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components';
import { navBar } from '../colors/Colors'
import HamburgerMenu from './HamburgerMenu'
import mainLogo from '../assets/peloton_logo.svg'
import { Dropdown, DropdownButton } from 'react-bootstrap'



function NavBar() {
  return (
    <Nav>
      <Link to="/">
        <img height="75" width="90" viewBox="0 0 25 36" src={mainLogo} alt="peloton-home-logo"/>
      </Link>
      {/* <HamburgerMenu /> */}
      <DropdownButton align="right" id="dropdown-basic-button" title="All">
        <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
        <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
        <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
      </DropdownButton>
    </Nav>
  );
}

const Nav = styled.nav`
  background-color: ${navBar};
  text-align: left;
  margin-bottom: 50px;
  class= navbar navbar-light;
`;

const DropDown = styled.div`
  text-align: right;

`

export default NavBar;
